import React from 'react'; 
import "./login.css";

const WrongInPut = (props)=> { 
    console.log(`this is email ${props.email}`)
    console.log(`this is email ${props.inputEmail}`)
    return <p className='wrong-input'>{`Wrong ${props.name} please try again`}</p>
}
export default WrongInPut;
